import React from 'react'
import { Provider } from 'react-redux'
import { createStore } from 'redux'
import reducers from 'reducers'

const Root = props => (
    <Provider store={createStore(reducers, props.initialState)}>
        {props.children}
    </Provider>
)

Root.defaultProps = {
    initialState: {}
}

export default Root
